            "summary": "Butternut Squash Frittatan is a <b>gluten free</b> main course. One serving contains <b>446 calories</b>, <b>24g of protein</b>, and <b>4g of fat</b>. For <b>$3.03 per serving</b>, this recipe <b>covers 50%</b> of your daily requirements of vitamins and minerals. 18 people were impressed by this recipe. If you have butternut squash, pepper, liquid egg substitute, and a few other ingredients on hand, you can make it. To use up the liquid egg substitute you could follow this main course with the <a href=\"https://spoonacular.com/recipes/blueberry-cake-51430\">Blueberry Cake</a> as a dessert. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 98%</b>. This score is excellent. Try <a href=\"https://spoonacular.com/recipes/butternut-squash-frittata-750335\">Butternut Squash Frittata</a>, <a href=\"https://spoonacular.com/recipes/sausage-and-butternut-squash-frittata-563285\">Sausage and Butternut Squash Frittata</a>, and <a href=\"https://spoonacular.com/recipes/butternut-squash-and-quinoa-frittata-521598\">Butternut Squash and Quinoa Frittata</a> for similar recipes.",
