            "summary": "Easy Vegetable Beef Soup might be just the main course you are searching for. One portion of this dish contains roughly <b>45g of protein</b>, <b>19g of fat</b>, and a total of <b>566 calories</b>. This dairy free recipe serves 8 and costs <b>$3.45 per serving</b>. Many people made this recipe, and 130 would say it hit the spot. It is brought to you by Pink When. It can be enjoyed any time, but it is especially good for <b>Autumn</b>. If you have butter beans, canned tomatoes, worcestershire sauce, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes about <b>2 hours and 30 minutes</b>. With a spoonacular <b>score of 0%</b>, this dish is improvable. Try <a href=\"https://spoonacular.com/recipes/easy-vegetable-beef-soup-1050610\">Easy Vegetable Beef Soup</a>, <a href=\"https://spoonacular.com/recipes/easy-vegetable-beef-soup-177116\">Easy Vegetable-Beef Soup</a>, and <a href=\"https://spoonacular.com/recipes/easy-vegetable-beef-soup-459390\">Easy Vegetable Beef Soup</a> for similar recipes.",
