            "summary": "If you have around <b>around 45 minutes</b> to spend in the kitchen, Roasted Endive Salad With Prosciutto, Figs and Pistachios might be a spectacular <b>gluten free, dairy free, paleolithic, and primal</b> recipe to try. One serving contains <b>494 calories</b>, <b>13g of protein</b>, and <b>24g of fat</b>. This recipe serves 4 and costs $3.64 per serving. If you have endive, figs, pistachio nuts, and a few other ingredients on hand, you can make it. 6 people were impressed by this recipe. It is brought to you by Foodista. It works well as a main course. Taking all factors into account, this recipe <b>earns a spoonacular score of 96%</b>, which is spectacular. <a href=\"https://spoonacular.com/recipes/frise-salad-with-prosciutto-roasted-figs-and-walnuts-96484\">Frisée Salad with Prosciutto, Roasted Figs, and Walnuts</a>, <a href=\"https://spoonacular.com/recipes/chicory-and-endive-salad-with-spiced-pistachios-12783\">Chicory and Endive Salad with Spiced Pistachios</a>, and <a href=\"https://spoonacular.com/recipes/prosciutto-roasted-figs-130081\">Prosciutto Roasted Figs</a> are very similar to this recipe.",
