            "summary": "Bacon Wrapped Pork Tenderloin is a <b>caveman, gluten free, dairy free, and primal</b> main course. For <b>$2.2 per serving</b>, this recipe <b>covers 30%</b> of your daily requirements of vitamins and minerals. One serving contains <b>411 calories</b>, <b>51g of protein</b>, and <b>21g of fat</b>. A couple people made this recipe, and 55 would say it hit the spot. If you have garlic powder, pepper, sage, and a few other ingredients on hand, you can make it. To use up the black pepper you could follow this main course with the <a href=\"https://spoonacular.com/recipes/dr-pepper-cake-with-flour-cooked-frosting-539165\">Dr. Pepper Cake with Flour Cooked Frosting</a> as a dessert. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 91%</b>. This score is outstanding. Try <a href=\"https://spoonacular.com/recipes/bacon-wrapped-pork-tenderloin-81832\">Bacon-Wrapped Pork Tenderloin</a>, <a href=\"https://spoonacular.com/recipes/bacon-wrapped-pork-tenderloin-253608\">Bacon Wrapped Pork Tenderloin</a>, and <a href=\"https://spoonacular.com/recipes/bacon-wrapped-pork-tenderloin-687182\">Bacon Wrapped Pork Tenderloin</a> for similar recipes.",
