            "summary": "You can never have too many main course recipes, so give Salmon, Watercress, Fennel and Baby Beetroot Salad With Lemony \"Caviar\" Dressing a try. This caveman, gluten free, dairy free, and primal recipe serves 4 and costs <b>$4.13 per serving</b>. One serving contains <b>433 calories</b>, <b>27g of protein</b>, and <b>29g of fat</b>. If you have baby beets, bay leaf, pepper, and a few other ingredients on hand, you can make it. Only a few people made this recipe, and 4 would say it hit the spot. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 93%</b>. This score is great. Try <a href=\"https://spoonacular.com/recipes/-wild-rice-baby-beetroot-beef-kofta-salad-ft-love-beets-baby-beetroot-494268\">[] Wild Rice, Baby Beetroot & Beef Kofta Salad (ft. Love Beets Baby Beetroot)</a>, <a href=\"https://spoonacular.com/recipes/poached-salmon-and-watercress-salad-with-dill-yogurt-dressing-14170\">Poached Salmon and Watercress Salad with Dill-Yogurt Dressing</a>, and <a href=\"https://spoonacular.com/recipes/beetroot-red-apple-and-watercress-salad-9732\">Beetroot, Red Apple And Watercress Salad</a> for similar recipes.",
